    this.service = opts?.service || IMServiceServiceName;
    this.rpc = rpc;
    this.RoutePrivateMessage = this.RoutePrivateMessage.bind(this);
    this.RouteGroupMessage = this.RouteGroupMessage.bind(this);
    this.GetMessageStatus = this.GetMessageStatus.bind(this);
